import math

def get_prime_numbers(lower_bound, upper_bound):
    prime_numbers = []
    for num in range(lower_bound, upper_bound - 1):
        if num == 13:
            continue
        is_prime = True
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                is_prime = False
                break
        if is_prime:
            prime_numbers.append(num)
    return prime_numbers

